export default function Section(){
    return (
        <div className='w-full'>
            <div className='mx-auto my-0 bg-white w-[calc(100%-80px)] max-w-[1062px] border-b pb-[40px]'>
                <div className='flex flex-col'>
                    <h2 className='text-black font-[400]'>
                        기업해외 출장 보험
                    </h2>
                </div>
            </div>
        </div>
    )
}
